(* Rule: code *)
let rec code p buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_code (buff : StringBuilder) (p : Position) _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            //CODE (buff.ToString(), p)
            CODE (Some <| buff.ToString())
        | 1 ->
            ignore <| buff.Append (lexeme lexbuf)
            ignore (code p buff lexbuf)
            ignore <| buff.Append "}"
            code p buff lexbuf
        | 2 ->
            newline lexbuf
            ignore <| buff.Append System.Environment.NewLine
            code p buff lexbuf
        | 3 ->
            ignore <| buff.Append (lexeme lexbuf)
            code p buff lexbuf
        | 4 ->
            ignore <| buff.Append (lexeme lexbuf)
            ignore (codestring buff lexbuf)
            code p buff lexbuf
        | 5 ->
            ignore <| buff.Append (lexeme lexbuf)
            code p buff lexbuf
        | 6 ->
            ignore <| buff.Append (lexeme lexbuf)
            code p buff lexbuf
        | 7 -> EOF
        | 8 ->
            ignore <| buff.Append (lexeme lexbuf).[0]
            code p buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'code' lexer rule." invalidAction
    
    _fslex_code buff p 0 lexbuf
    
(* Rule: codestring *)
and codestring buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_codestring (buff : StringBuilder) _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            ignore <| buff.Append (lexeme lexbuf)
            codestring buff lexbuf
        | 1 ->
            ignore <| buff.Append (lexeme lexbuf)
            buff.ToString ()
        | 2 ->
            newline lexbuf
            ignore <| buff.Append System.Environment.NewLine
            codestring buff lexbuf
        | 3 ->
            ignore <| buff.Append (lexeme lexbuf)
            codestring buff lexbuf
        | 4 ->
            failwith "unterminated string in code"
        | 5 ->
            ignore <| buff.Append(lexeme lexbuf).[0]
            codestring buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'codestring' lexer rule." invalidAction
    
    _fslex_codestring buff 17 lexbuf
    
(* Rule: comment *)
and comment (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_comment _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            ignore (comment lexbuf)
            comment lexbuf
        | 1 ->
            newline lexbuf
            comment lexbuf
        | 2 -> ()
        | 3 ->
            failwith "end of file in comment"
        | 4 ->
            comment lexbuf
        | 5 ->
            comment lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'comment' lexer rule." invalidAction
    
    _fslex_comment 28 lexbuf
    
(* Rule: fs_type *)
and fs_type (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_fs_type _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            incr typeDepth
            appendBuf (lexeme lexbuf)
            fs_type lexbuf
        | 1 ->
            appendBuf (lexeme lexbuf)
            fs_type lexbuf
        | 2 ->
            decr typeDepth
            if !typeDepth = 0 then
                Some <| string str_buf
            else
                appendBuf (lexeme lexbuf)
                fs_type lexbuf
        | 3 ->
            appendBuf (lexeme lexbuf)
            fs_type lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'fs_type' lexer rule." invalidAction
    
    _fslex_fs_type 36 lexbuf
    
(* Rule: header *)
and header p buff (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_header (buff : StringBuilder) (p : Position) _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            //HEADER (buff.ToString(), p)
            HEADER (Some <| buff.ToString())
        | 1 ->
            newline lexbuf
            ignore <| buff.Append System.Environment.NewLine
            header p buff lexbuf
        | 2 ->
            ignore <| buff.Append (lexeme lexbuf)
            header p buff lexbuf
        | 3 ->
            ignore <| buff.Append (lexeme lexbuf)
            header p buff lexbuf
        | 4 ->
            ignore <| buff.Append (lexeme lexbuf)
            header p buff lexbuf
        | 5 ->
            ignore <| buff.Append (lexeme lexbuf)
            ignore(codestring buff lexbuf)
            header p buff lexbuf
        | 6 -> EOF
        | 7 ->
            ignore <| buff.Append(lexeme lexbuf).[0]
            header p buff lexbuf
        | invalidAction ->
            failwithf "Invalid action index (%i) specified for the 'header' lexer rule." invalidAction
    
    _fslex_header buff p 42 lexbuf
    
(* Rule: token *)
and token (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) =
    let _fslex_token _fslex_state lexbuf =
        match _fslex_tables.Interpret (_fslex_state, lexbuf) with
        | 0 ->
            let p = lexbuf.StartPos
            header p (StringBuilder 100) lexbuf
        | 1 ->
