        | 2 ->
            typeDepth := 1
            startPos := lexbuf.StartPos
            clearBuf ()
            TOKEN (fs_type lexbuf)
        | 3 ->
            TOKEN None
        | 4 ->
            START
        | 5 ->
            PREC
        | 6 ->
            typeDepth := 1
            startPos := lexbuf.StartPos
            clearBuf ()
            match fs_type lexbuf with
            | Some x ->
                TYPE x
            | None ->
                failwith "gettype"
        | 7 ->
            LEFT
        | 8 ->
            RIGHT
        | 9 ->
            NONASSOC
        | 10 ->
            ERROR
        | 11 ->
            LESS
        | 12 ->
            GREATER
        | 13 ->
            SEMI
        | 14 ->
            let p = lexbuf.StartPos
            let buff = StringBuilder 100
            // adjust the first line to get even indentation for all lines w.r.t. the left hand margin
            buff.Append (String.replicate (lexbuf.StartPos.Column + 1) " ") |> ignore
            code p buff lexbuf
        | 15 ->
            token lexbuf
        | 16 ->
            newline lexbuf; token lexbuf
        | 17 ->
            IDENT (lexeme lexbuf)
        | 18 ->
            BAR
        | 19 ->
            ignore(comment lexbuf); token lexbuf
        | 20 ->
            token lexbuf
        | 21 ->
            COLON
        | 22 ->
            unexpected_char lexbuf
        | 23 ->
            EOF
        | invalidAction ->
